[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "
PREFIX up: <http://purl.uniprot.org/core/>
PREFIX taxon: <http://purl.uniprot.org/taxonomy/>

SELECT (COUNT(DISTINCT ?protein) AS ?count)
WHERE {
  ?protein a up:Protein ;
           up:organism taxon:9606 ;
           up:reviewed true .
}
"}}]

[{"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dcterms: <http://purl.org/dc/terms/>
PREFIX nando: <http://nanbyodata.jp/ontology/nando#>

SELECT DISTINCT ?nando_id ?label ?description
WHERE {
  ?disease a nando:NANDO_0000001 ;
           rdfs:label ?label ;
           dcterms:identifier ?nando_id .
  OPTIONAL { ?disease dcterms:description ?description }

  FILTER(CONTAINS(LCASE(STR(?label)), "parkinson"))
}
LIMIT 20
"}}, {"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "nando"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "nando", "sparql_query": "
PREFIX owl: <http://www.w3.org/2002/07/owl#>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
PREFIX dct: <http://purl.org/dc/terms/>
PREFIX nando: <http://nanbyodata.jp/ontology/NANDO_>

SELECT ?disease ?identifier ?label ?notif_num
FROM <http://nanbyodata.jp/ontology/nando>
WHERE {
  ?disease a owl:Class ;
           rdfs:label ?label ;
           dct:identifier ?identifier .
  OPTIONAL { ?disease nando:hasNotificationNumber ?notif_num }
  ?label bif:contains "'Parkinson*'" option (score ?sc) .
  FILTER(LANG(?label) = "en")
}
ORDER BY DESC(?sc)
LIMIT 10
"}}]

[{"name": "mcp__togomcp__get_MIE_file", "input": {"dbname": "uniprot"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>

SELECT (COUNT(DISTINCT ?protein) as ?count)
WHERE {
  ?protein a up:Protein ;
           up:reviewed 1 ;
           up:organism <http://purl.uniprot.org/taxonomy/9606> ;
           up:recommendedName ?name .
  ?name up:fullName ?fullName .
  ?fullName bif:contains "'kinase'"
}"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "uniprot", "sparql_query": "PREFIX up: <http://purl.uniprot.org/core/>

SELECT ?protein ?mnemonic ?fullName
WHERE {
  ?protein a up:Protein ;
           up:reviewed 1 ;
           up:organism <http://purl.uniprot.org/taxonomy/9606> ;
           up:mnemonic ?mnemonic ;
           up:recommendedName ?name .
  ?name up:fullName ?fullName .
  ?fullName bif:contains "'kinase'"
}
LIMIT 10"}}]

[{"name": "mcp__ols__fetch", "input": {"id": "go+http://purl.obolibrary.org/obo/GO_0016236"}}, {"name": "mcp__togomcp__run_sparql", "input": {"dbname": "go", "sparql_query": "PREFIX obo: <http://purl.obolibrary.org/obo/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>

SELECT DISTINCT ?parent ?parentLabel
WHERE {
  obo:GO_0016236 rdfs:subClassOf ?parent .
  FILTER(isIRI(?parent))
  OPTIONAL { ?parent rdfs:label ?parentLabel }
}
ORDER BY ?parent"}}]
